import { useState, useEffect } from 'react';
export const SubmitTheTicket = (formDetails,showIndividualTicket) => {
  const [ticketDetail, setTicketDetail] = useState(null);
  useEffect(() => {
    const requestOptions = {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(formDetails),
    };
    getData();

    // we will use async/await to fetch this data
    async function getData() {
      const response = await fetch("http://localhost:8000/getAllDevelopers", requestOptions);
      const apiResponseData = await response.json();
      setTicketDetail(apiResponseData);

    }
  }, [formDetails]);
  showIndividualTicket(ticketDetail);
}
